    and return it in lowercase.
    Restrictions: 1 <= num <= 1000

    Examples:
    >>> int_to_mini_roman(19) == 'xix'
    >>> int_to_mini_roman(152) == 'clii'
    >>> int_to_mini_roman(426) == 'cdxxvi'
    """
    def int_to_roman(number):
        if number >= 500:
            return 'd' + int_to_roman(number - 500)
        elif number >= 100:
            return 'c' + int_to_roman(number - 100)
        elif number >= 50:
            return 'l' + int_to_roman(number - 50)
        elif number >= 10:
            return 'x' + int_to_roman(number - 10)
        elif number >= 5:
            return 'v' + int_to_roman(number - 5)
        elif number >= 1:
            return 'i' + int_to_roman(number - 1)
    return int_to_roman(number)

